import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonLabel, IonItem, IonCheckbox, IonButton } from '@ionic/react';
import './Tab1.css';

function onAddChore(choreText: string) {
  return (
    <IonItem>
      <IonLabel class="chore-label">
        {choreText}
      </IonLabel>
      <IonCheckbox />
    </IonItem>
  )
}

const Tab1: React.FC = () => {
  return (
    <IonPage>
      <IonContent class="page-content">
        <IonContent class="header-content">
          <IonHeader class="header-container">
            <IonToolbar>
              <IonTitle class="tab-title" size="large">Track your daily chores here!</IonTitle>
            </IonToolbar>
          </IonHeader>
        </IonContent>
        <IonContent class="body-content">
          <IonButton onClick={() => onAddChore('test')}>
            Add new chore
          </IonButton>
          <IonItem>
            <IonLabel class="chore-label">
              Daily chore 1
            </IonLabel>
            <IonCheckbox />
          </IonItem>
        </IonContent>
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
